import React from "react";
import main from "./assets/main.jpg";
import coffeeLogo from "./assets/jasmine.png";
import CircularText from "./CircularText";
import SimpleNavbar from "./SimpleNavbar";
import { Link } from "react-router-dom";
import { FaShoppingCart, FaHome } from "react-icons/fa";

export default function Home() {
  const [btnHover, setBtnHover] = React.useState(false);

  const btnStyle = {
    padding: "12px 20px",
    background: "#6f4e37", // rich coffee brown
    color: "wheat",
    borderRadius: "25px",
    border: "2px solid #4b3621",
    fontFamily: "'Sansita Swashed', cursive",
    fontSize: "1.1rem",
    boxShadow: "0 4px 8px rgba(111, 78, 55, 0.4)",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
  };

  const btnHoverStyle = {
    background: "#4b3621",
    borderColor: "#6f4e37",
  };

  const radius = 110;

  const containerStyle = {
    display: "flex",
    padding: "1.5rem",
    fontFamily: "'Roboto', sans-serif",
    backgroundColor: "#fff7f0",
    minHeight: "100vh",
    color: "#4b3621",
    alignItems: "center",
    gap: "2rem",
  };

  const leftImageStyle = {
    width: "50%",
    height: "auto",
    borderRadius: "15px",
    boxShadow: "5px 5px 15px rgba(111, 78, 55, 0.3)",
  };

  const rightContentStyle = {
    width: "50%",
    textAlign: "center",
    padding: "1rem 2rem",
  };

  const circularTextTopStyle = {
    position: "absolute",
    top: 0,
    left: 0,
    fontFamily: "'Ribeye Marrow', cursive",
    color: "#6f4e37",
    filter: "drop-shadow(0 0 1px #4b3621)",
  };

  const circularTextBottomStyle = {
    position: "absolute",
    top: "calc(40% - 60px)",
    left: 0,
    fontFamily: "'Ribeye Marrow', cursive",
    color: "#6f4e37",
    filter: "drop-shadow(0 0 1px #4b3621)",
  };

  // Fixed position styles for the buttons
  const fixedOrderBtnStyle = {
    position: "fixed",
    top: "50%", // vertical center
    left: "10px",
    transform: "translateY(-50%)",
    ...btnStyle,
    width: "220px",
    zIndex: 1000,
  };

  const fixedBottomRightContainer = {
    position: "fixed",
    bottom: "20px",
    right: "20px",
    display: "flex",
    flexDirection: "column",
    gap: "15px",
    zIndex: 1000,
  };

  const iconBtnStyle = {
    background: "#6f4e37",
    color: "wheat",
    border: "none",
    borderRadius: "50%",
    width: "50px",
    height: "50px",
    fontSize: "1.8rem",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    cursor: "pointer",
    boxShadow: "0 4px 8px rgba(111, 78, 55, 0.5)",
    transition: "background-color 0.3s ease",
  };

  return (
    <>
      <div style={containerStyle}>
        {/* Left image */}
        <img src={main} alt="Coffee Shop Main" style={leftImageStyle} />

        {/* Right content */}
        <div style={rightContentStyle}>
          <SimpleNavbar />

          {/* Circular text and logo */}
          <div
            style={{
              position: "relative",
              width: `${radius * 2}px`,
              height: `${radius * 2 + 40}px`,
              margin: "2rem auto",
            }}
          >
            <div style={circularTextTopStyle}>
              <CircularText
                text="The Daily Grind"
                radius={radius}
                startAngle={180}
                endAngle={0}
                invert={false}
                rotateLetters={false}
              />
            </div>

            <img
              src={coffeeLogo}
              alt="Coffee Logo"
              style={{
                position: "absolute",
                top: "50%",
                left: "50%",
                width: "150px",
                height: "150px",
                transform: "translate(-50%, -50%)",
                borderRadius: "50%",
                boxShadow: "0 0 15px rgba(111, 78, 55, 0.6)",
                border: "4px solid #6f4e37",
                backgroundColor: "#f3e9dc",
              }}
            />

            <div style={circularTextBottomStyle}>
              <CircularText
                text="Coffee House"
                radius={radius}
                startAngle={180}
                endAngle={360}
                invert={true}
                rotateLetters={false}
              />
            </div>
          </div>

          {/* Info text */}
          <p
            style={{
              marginTop: "2rem",
              fontSize: "14px",
              fontStyle: "italic",
              color: "#6f4e37",
              maxWidth: "280px",
              marginLeft: "auto",
              marginRight: "auto",
              lineHeight: "1.4",
            }}
          >
            When placing an order, select the option
            <br />
            <b>"Contactless delivery"</b> and the courier will leave your order at
            the door.
          </p>
        </div>
      </div>

      {/* Fixed ORDER NOW button on left */}
      <Link to="/coffee">
        <button
          style={btnHover ? { ...fixedOrderBtnStyle, ...btnHoverStyle } : fixedOrderBtnStyle}
          onMouseEnter={() => setBtnHover(true)}
          onMouseLeave={() => setBtnHover(false)}
        >
          ORDER NOW
        </button>
      </Link>

      {/* Fixed bottom right icons */}
      <div style={fixedBottomRightContainer}>
        <Link to="/">
          <button style={iconBtnStyle} title="Back to Home" aria-label="Back to Home">
            <FaHome />
          </button>
        </Link>

        <Link to="/cart">
          <button style={iconBtnStyle} title="View Cart" aria-label="View Cart">
            <FaShoppingCart />
          </button>
        </Link>
      </div>
    </>
  );
}
